import Item from './Item';
import { Event } from '../models/event';

interface props {
    events: Array<Event>;
    id: number;
    text: string;
    date: string;
}

const Events: React.FC<props> = ({events}) => {
    return (
        <>
        <h1>Event list: </h1>
        {events?.map((event, index) => (
            <Item 
                id={event.id}
                text={event.text}
                date={event.date}
            />  
         ))}

        </>
    )
}


export default Events
